import React from 'react'
import './Trade.css';
import TradingViewWidget from 'react-tradingview-widget';

export default function Shorts() {



let width = TradingViewWidget.width = '500px'
let heighty = TradingViewWidget.height = '500px'
let themey = TradingViewWidget.theme = 'Dark' ;
// let interval = TradingViewWidget.interval= "60" 
let indicators =  TradingViewWidget.studies = [ "RSI@tv-basicstudies"]

let createStudy = TradingViewWidget.createStudy = ('Compare', false, false, ["open", 'APPL'])

return (
<div className="Charts">

<TradingViewWidget

    symbol= "BITFINEX:BTCUSDLONGS"
    theme={themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='D'
    studies={indicators}  
    width={width}
    height={heighty}  
    createStudy={createStudy}
        // rangeTypes='ALL' 
      // autoSize='true'  
      // autoSize={true} 
/>

<TradingViewWidget
    symbol="BITFINEX:BTCUSDSHORTS"
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='D'
    studies={indicators}  

  />

<TradingViewWidget
    symbol= "BITFINEX:ETHUSDLONGS" 
    theme= {themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    width={width}
    height={heighty}
    style='8'
    interval='D'
    studies={indicators}          
  />


<TradingViewWidget

    symbol="BITFINEX:ETHUSDSHORTS"
    theme={themey}
    BarStyles='HEIKIN_ASHI'
    locale="en"
    style='8'
    interval='D'
    studies={indicators}  
    width={width}
    height={heighty}  
        // rangeTypes='ALL' 
      // autoSize='true'   
/>


</div>
)
}
